import Title from '../title';

export default function Marcas() {
  return (
    <div className="bg-[#28082e] py-24 sm:py-12">
      <Title title={'ferramentas que trabalhamos '} />
      <div className="mx-auto max-w-7xl px-6 lg:px-8">
        <div className="mx-auto mt-10 grid max-w-lg grid-cols-3 items-center gap-x-8 gap-y-10 sm:max-w-xl sm:grid-cols-3 sm:gap-x-10 lg:mx-0 lg:max-w-none lg:grid-cols-3">
          <div className="bg-white rounded-3xl h-16   mx-8">
            <img
              className="col-span-2 max-h-12 w-full object-contain lg:col-span-1"
              src={`${process.env.PUBLIC_URL}/../../../assets/facebook-ads.png`}
              alt="Reform"
              width={158}
              height={48}
            />
          </div>
          <div className="bg-white rounded-3xl h-16   mx-8">
            <img
              className="col-span-2 max-h-12 w-full object-contain lg:col-span-1"
              src={`${process.env.PUBLIC_URL}/../../../assets/google-ads.png`}
              alt="Reform"
              width={158}
              height={48}
            />
          </div>

          <div className="bg-white rounded-3xl h-16   mx-8">
            <img
              className="col-span-2 max-h-12 w-full object-contain lg:col-span-1"
              src={`${process.env.PUBLIC_URL}/../../../assets/instagram.png`}
              alt="Reform"
              width={158}
              height={48}
            />
          </div>

          <div className="bg-white rounded-3xl h-16  ">
            <img
              className="col-span-2 max-h-12 w-full object-contain lg:col-span-1"
              src={`${process.env.PUBLIC_URL}/../../../assets/linkedin.png`}
              alt="Reform"
              width={158}
              height={48}
            />
          </div>

          <div className="bg-white rounded-3xl h-16  ">
            <img
              className="col-span-2 max-h-12 w-full object-contain lg:col-span-1"
              src={`${process.env.PUBLIC_URL}/../../../assets/face.png`}
              alt="Reform"
              width={158}
              height={48}
            />
          </div>

          <div className="bg-white rounded-3xl h-16  ">
            <img
              className="col-span-2 max-h-12 w-full object-contain lg:col-span-1"
              src={`${process.env.PUBLIC_URL}/../../../assets/google.png`}
              alt="Reform"
              width={158}
              height={48}
            />
          </div>
        </div>
      </div>
    </div>
  );
}
